import React from "react";
import { responsive } from "./responsive.js";
import {Side_bar} from "./side_bar.js";
import ReactDOM from "react-dom";
import { Heading } from "./heading.js";
import img from './ds.png'
export class Dsa_header extends React.Component{
    constructor(props){
        super(props)
        this.state={style:responsive.dsa.Main(),image:responsive.dsa.image(img),text:responsive.dsa.text()}
        this.handleClick=this.handleClick.bind(this)
        this.resize=this.resize.bind(this);
        window.addEventListener('resize',this.resize);
    }
    resize(){
        this.setState({style:responsive.dsa.Main(),image:responsive.dsa.image(img),text:responsive.dsa.text()})
    }
    handleClick(){
        ReactDOM.render(<Dsa/>,document.getElementById('root'));
    }
    render(){
        return(
            <button style={this.state.style} onClick={this.handleClick}>
                <div style={this.state.image}>
                </div>
             <p style={this.state.text}>
                <h1>C++</h1>
                CPP is a low level programming language developed which is considered as one of the fastest compiled programing language
                take mock test on pointers,templates,OOP's and various topics on CPP
            </p>
            </button>
        )
    }
}
class Dsa extends React.Component{
    constructor(props){
        super(props)
        let arr=['Array','Stack','Queue','LinkedList','Trees','Graphs','Hash\nTables','Trie','Segment Tree']
        this.state={Topics:arr}
    }
    render(){
        return (
            <div>
                <Heading/>
                <Side_bar arr={this.state.Topics}/>
            </div>
        )
    }
}
